	 ('2021-04-15 21:07:57','2021-04-15 21:07:57','b9ab4a93-b71b-4f7e-9b90-30b7c8e8854a','0ea49e2a-bbce-4435-814b-68a975eb48c9','Acting 101','As your acting mentor you will get an uninterrupted hour of someone sitting with you and focusing just on you and your personal acting goals. Focusing on what you are working on; how you are working on it; what you want to achieve; and most importantly, tips on how to help you achieve it more quickly.

