♥ Establishing a great approach to meeting key professionals in the business.
♥ Teaching you how to remain positive in the face of a challenging industry; new perspectives on acting and the performing arts.
♥ Guidance on how to nail your casting type.
♥ A tried and tested process to ensure your branding is 100% accurate.
♥ Ideas on new ways to look at the acting world.
♥ Suggestions for your own website and guidance on how to build one.
♥ How to establish and grow your acting business.
♥ Thoughts on effective networking and targeting high quality acting projects.
♥ Sharing stories of my first-hand experience.
♥ Becoming more confident about your strengths and more knowledgeable about your areas for improvement. Working towards becoming a recognisable B.A.B.E..
♥ An ever-expanding group of contacts in UK/Europe, the US and Australia. Includes agents, managers, casting directors, that I draw from to suit your personal acting goals.
♥ And finally, I also have endless spreadsheets, contacts and other material if you want to take it further and spend more time working on a specific area of your career.',0.0,105.0,'SGD','PUBLISHED',NULL,NULL),
	 ('2021-04-15 21:13:14','2021-04-15 21:13:14','baa34832-cfb5-4af2-8e2b-3fe1b5b11d48','f3c331fb-6d7b-498c-ae07-794ed5ff6c92','JPS Health and Fitness Mentorship','The objective of our online mentorship is to provide coaches with a truly evidence-based online mentorship course that bridges the gap between the science and the real world.

This is why we have enlisted experts and industry leaders from a variety of different fields and backgrounds to contribute to the course curriculum.

We want to give coaches not just the best available science and information in fitness education, but present it in a way that makes it easily applied to your clients to get world-class results.

The course includes foundational knowledge that all coaches must possess, as well as in-depth details and advanced information that will allow you to stand out amongst the pack. It is our goal to help you achieve excellence within the fitness industry and take your passion for fitness and turn it into a sustainable and lucrative career.

Additional to the core online mentorship course curriculum, students will have access to hours and hours of bonus modules, science and fitness articles and content. We also provide students with monthly Q&A’s.',0.0,45.0,'SGD','PUBLISHED',NULL,NULL),
